function screenshotsRecursive(samples, callback) {
  if (!samples.length) {
    callback && callback();
    return;
  }

  samples.pop().save().then(() => {
    screenshotsRecursive(samples, callback);
  });
}

testing.screenshotsPopulate = function (recordManager) {
  const samples = createSamples(recordManager);

  recordManager.clear(() => {
    screenshotsRecursive(samples, () => {

    });
  });
};

